import React from "react";
import { Stack, Box } from "@mui/material";

const Videos = ({ videos }) => {
  return (
    <div>
      <Stack direction="row" flexWrap="wrap">
        {videos.map((item, idx) => (
          <Box key={idx}>{item.id.videoId && <VideoCard video={item} />}</Box>
        ))}
      </Stack>
    </div>
  );
};

export default Videos;
